function App() {
  const {data: t} = getEntities({name: "tournaments"})
  console.log("data");
  console.log(t);
  return (
    <ChakraProvider>
    <div className="App">
      {t && t.data.map(tr => <h4>{tr.attributes.name}</h4>)}
    </div>
    </ChakraProvider>
  );
}

export default App;
